import React,{Component} from 'react';
import Navbar from "./navbar";
import Card from "./card";
class App extends Component{
    state = {};
    render(){
        return <div>
            (<Navbar/> )
            (<Card/>)
            (<Card/>)
        </div>;
    }
}
export default App;
